];
const detailFields = ['MainGUID', 'data_point', 'ref_field'];
const fileFields = ['MainGUID', 'GDriveID', 'Link'];

// Input branches
const mainItems = $input.all(0).map(i => i.json);
const detailItems = $input.all(1).map(i => i.json);
const fileItems = $input.all(2).map(i => i.json);

// Field filter helper
const filterFields = (obj, fields) =>
  Object.fromEntries(fields.map(f => [f, obj[f]]));

// Deduplicate helper
const deduplicate = (arr) => {
  const seen = new Set();
  return arr.filter(item => {
    const key = JSON.stringify(item);
    if (seen.has(key)) return false;
    seen.add(key);
    return true;
  });
};

// 1 Deduplicate mains by uuid
const uniqueMains = {};
for (const item of mainItems) {
  const uuid = item.uuid;
  if (!uniqueMains[uuid]) {
    const mainObj = filterFields(item, mainFields);

    // Add user role and project from body.user
    mainObj.user_role = item?.body?.user?.role || null;
    mainObj.user_project = item?.body?.user?.project || null;

    uniqueMains[uuid] = mainObj;
  }
}

// 2 Build final output  match details/files by uuid
const result = Object.values(uniqueMains).map(main => {
  const uuid = main.uuid;
  const matchedDetails = detailItems
    .filter(d => d.MainGUID === uuid)
    .map(d => filterFields(d, detailFields));
  const matchedFiles = fileItems
    .filter(f => f.MainGUID === uuid)
    .map(f => filterFields(f, fileFields));

  return {
    json: {
      ...main,
      details: deduplicate(matchedDetails),
      files: deduplicate(matchedFiles)
    }
  };
});

return result;
